import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Set mobile viewport
    await page.setViewportSize({ width: 375, height: 812 });

    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open mobile menu
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Wait for mobile menu to open and take screenshot
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // Click on a menu item (Electronics)
    await page.waitForSelector('#mobileMenuOverlay.show a[href="#"]', { timeout: 5000 });
    const menuItems = await page.$$('#mobileMenuOverlay.show a[href="#"]');
    await menuItems[0].click(); // First Electronics link

    // Wait for navigation and take screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_click.png'));

    // Close mobile menu
    await page.waitForSelector('.close-mobile-menu', { timeout: 5000 });
    await page.click('.close-mobile-menu');

    // Verify menu is closed and take final screenshot
    await page.waitForSelector('#mobileMenuOverlay:not(.show)', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    return {
      success: true,
      action: "Tested mobile menu navigation by opening menu, clicking Electronics link, and closing menu",
      extractedData: {
        menuOpened: true,
        menuClosed: true,
        navigationAttempted: true
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
